import styled from 'styled-components';
import {PageWrap} from '../../components/common/styled'
import Header from '../../components/common/header'
import {MdOutlineArrowDropDown} from 'react-icons/md'
const Exploring = () => {
  return (
    <PageWrap>
      <Header />
      <CompanyListBox>
        <CompanyListCenter>
          <CompanyFilterBox>
            <FilterLiftBox>
              <TagFilterBtn>태그 딱 맞는 기업 찾기<Spans /></TagFilterBtn>
            </FilterLiftBox>
            <FilterRightBox></FilterRightBox>
          </CompanyFilterBox>
        </CompanyListCenter>
      </CompanyListBox>
    </PageWrap>
  )
}

const CompanyListBox = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;
`
const CompanyListCenter = styled.div`
  max-width: 1060px;
  width: 100%;
  display: flex;
  flex-direction: column;
  padding: 20px 0 80px;
  background: red;
`
const CompanyFilterBox = styled.div`
  top: 50px;
  margin-bottom: 19px;
  padding-top: 10px;
  & .icons{
    font-size: 24px;
  }
`
const FilterLiftBox = styled.div`
`
const FilterRightBox = styled.div`
`
const TagFilterBtn = styled.button`
  -webkit-box-align: center;
  align-items: center;
  display: inline-flex;
  height: 40px;
  padding: 0 39px 0 15px;
  margin-bottom: 0;
  border-radius: 5px;
  border: 1px solid #ececec;
  position: relative;
`
const Spans = styled.span`
  content: "";
  top: 50%;
  right: 16px;
  width: 0;
  height: 0;
  position: absolute;
  z-index: 99;
  border-top: 6px solid #333;
  border-left: 4px solid transparent;
  border-right: 4px solid transparent;
  -webkit-transform: translateY(-50%);
  transform: translateY(-50%);
`
export default Exploring;
